import React from "react"
import Navbar from "../components/Navbar.js"

function Shop(){
  return(
    <div>
      <div className = "col-md-3">
        <Navbar/>
      </div>
      <div className = "col-md-9">
        <h1>Shop</h1>
      </div>
    </div>
  )
}

export default Shop;
